import axios from 'axios';

export default async function checkNewFlag(flag) {
  let config = {
    headers: { 
        'Cache-Control': 'no-cache',
        'Content-Type': 'text/plain'
    }
  }

  return axios.post(`${process.env.REACT_APP_DEV_URL}ldps_workers`, flag, config)
    .then((res, err) => {
      dispatchEvent({type: 'POST', payload: res})
    })
};
